import React from 'react';

const APoDResult = ({ date, explanation, media_type, title, url }) => {
	return (
		<div>
			<h2>Picture of the day for {new Date(date).toLocaleString('en', { year: 'numeric', month: 'long' })}</h2>
			{media_type === 'image' ? <img src={url} /> : null}
		</div>
	);
};

export default APoDResult;
